    private static List<GpsValue> converPoint(List<GpsValue> list,int dataLength,int index) throws InterruptedException {
        String lnglats = getLnglats(list,dataLength,index);
        String url = "http://api.map.baidu.com/geoconv/v1/?coords="+lnglats+"&from=1&to=5&ak=loKXMdsU0cK3SuQvzKqbKOsluzF7aDGt";
        String respStr = HttpUtil.httpGet(url);
        MapConverResult result = JsonUtils.jsonToPojo(respStr,MapConverResult.class);
        return recoup(list,result,dataLength,index);
    }

    private static String getLnglats(List<GpsValue> list,int dataLength,int index) {
        StringBuilder lnglats = new StringBuilder();
        for(int i = 0;i < size;i++) {
            if(index>=dataLength){
                return lnglats.toString();
            }
            GpsValue value = list.get(index);
            lnglats.append(value.getLongitude()).append(",").append(value.getLatitude());
            if(i ==0 && index!= dataLength-1) {
                lnglats.append(";");
            }
            index++;
        }
        return lnglats.toString();
    }

    private static List<GpsValue> recoup(List<GpsValue> list,MapConverResult result,int dataLength,int index) throws InterruptedException {
        if(result != null) {
            //处理返回的数据
            list = merge(list,result,index);
        }
        if(index < dataLength) {
            //回调
            converPoint(list,dataLength,index);
        } else {
            return list;
        }
        return list;
    }

    /**
     * 将转换后的坐标替换原来的坐标
     * @param list
     * @param result
     */
    private static List<GpsValue> merge(List<GpsValue> list,MapConverResult result,int index) {
        List<MapConverValue> values = result.getResult();
        int size = values.size();
        for(int i = index-size; i < index;i++) {
            GpsValue gpsValue = list.get(i);
            MapConverValue converValue = values.get(i%2);
            gpsValue.setLatitude(converValue.getY());
            gpsValue.setLongitude(converValue.getX());
            list.set(i,gpsValue);
        }
        return list;
    }

